def create_members():
    members = []
    for _ in range(50):
        name = fake.name()
        first_name, last_name = name.split(' ')[:2]
        email = f'{first_name.lower()}.{last_name.lower()}@percplay.com'
        random_avatar = f"https://ui-avatars.com/api/?name={name.replace(' ', '+')}&rounded=true"

        m = Member(
            name=name,
            email=email,
            age=randint(18, 100),
            avatar=random_avatar
        )
        members.append(m)

    return members


