def create_reviews():
    reviews = []
    for _ in range(250):
        review = fake.sentence()

        r = Review(
            content=review,
            rating=randint(1, 5),
            member_id=rc([member.id for member in members]),
            instrument_id=rc([instrument.id for instrument in instruments])
        )
        reviews.append(r)

    return reviews
    

